const Home = () => {

    const authToken = true

    return (
        <div className="home">
            <h1>Swipe Right</h1>
            <button className="primary-button" onClick={handleClick}>
                {authToken ? 'Sign' : 'Create account'}
            </button>

        </div>
    )
}

export default Home
